import React, {Component} from 'react';
import './App.css';


class History_nav extends Component{
  render(){
    return(
      <nav>
        <div>LOGIN</div>
        <div>CALENDER</div>
        <div>STATICS</div>
      </nav>
    );
  }
}
var now_time = new Date();


class Home_nav extends Component{
  render(){
    return(
      <header>
        <h1>Anfree</h1>
        <div>we want to free from anxity</div><br></br>
        <div>now_time</div>
      </header>
    );
  }
}

class Todo_list extends Component{
  render(){
    return(
      <input type="text" placeholder='add your anxity'></input>
    );
  }
}




function App() {
  return (
    <div className="App">
      <header className="App-header">
        <History_nav></History_nav>
        <Home_nav></Home_nav>
        <Todo_list></Todo_list>
      </header>
    </div>
  );
}

export default App;
